import styled from "styled-components";
import Post from "./posts/post";

function App() {
  return (
    <div>
      <link href="./posts/post.tsx">
        <a href="">Post</a>
      </link>
    </div>
  );
}

const Title = styled.h1`
  color: #333;
`;

export default App;
